(2, 'second@membre.com', 'd65bcd4a2873b66ab7b1435a14dd03fd803bee94', 0, 'Yvette Runte', 'USER_IMG_2.jpg', 'Passionne de surf depuis 1995, Yvette Runte s\'illustre de manire regulire dans les comptitions internationales', '2018-12-11', 1),
(3, 'troisieme@membre.com', '2c7b420afef51541d762442fef7475c42e19c13f', 0, ' Madilyn King MD', 'USER_IMG_3.jpg', ' Madilyn King MD est originaire du Texas, il pratique le kayak depuis l\'age de 5 ans et  participer  plusieurs expditions internationales', '2019-03-22', 1),
(4, 'quatrieme@membre.com', 'a251138bf24e56d601e5abca99c51f92b9533c6a', 0, 'Katherine Pagac', 'USER_IMG.jpg', 'Fille unique de l\'illustre apniste Edmond Pagac, Katherine nous partage son exprience d\'un domaine qu\'elle connait depuis l\'enfance', '2019-07-12', 1),
(5, 'cinquieme@membre.com', '3f7237fe8bb6d8a0e91636839f9102089a8047c9', 0, 'Prof. Lester Heller', 'USER_IMG.jpg', 'Le Professeur Lester Heller est originaire de Jersey. Professeur d\'ocanographie  l\'universit de Berkeley, il porte  son palmares plusieurs tour du monde  bord de son voilier en solitaire', '2019-11-02', 1),
(6, 'sixieme@membre.com', 'b1e45396867fb5a86045ee73fc6e220a194b50d1', 0, 'Rudy Parker', 'USER_IMG.jpg', 'Rudy Parker est un freestyler renomme du monde du ski nautique. Touche  tout, il nous donne ses bons plans sur toute la gamme aquatique', '2019-12-02', 1),
(7, 'septieme@membre.com', '6c953d6a226f62f9fc3a45dc1d828762fd8791be', 0, 'Manuela Beatty', 'USER_IMG.jpg', 'Manuella Beatty est une globe trotteuse d\'origine italienne. Aquaphile elle totalise pas moins de 5000 plonges et 2000 apnes  son actif.', '2019-12-09', 1),
(8, 'huitieme@membre.com', '78b14bc1bd439e001e08cff513541b56e0a201b2', 0, 'Antoine Garnac', 'USER_IMG.jpg', 'Specialiste de la scurit dans les sports aquatiques, il nous partage ses bons plans et ses recommandations pour pratiquer notre passion sans danger', '2019-12-18', 1);
